import * as React from 'react';
import Button from '@mui/material/Button';



class PolicySelect extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            requiredItem: 0,
            data: [
                {"Id": 1, "Name": "Key Management"},
                {"Id": 2,"Name": "Role Management"},
                {"Id": 3,"Name": "Resource Management"}
            ]
        }
    }
    render () {
        return (
            <div>
            <h1>Policy Assets</h1>
            <p align = "right">
                <button>Create New Policy</button>
            </p>
            <p margin="20px 20px 20px 20px">Select Policy</p>
            <select>
            {this.state.data.map((option) => (
              <option value={option.value}>{option.label}</option>
            ))}
          </select>
            <p align="right">
                <button> Cancel </button>
                <button> Save </button>
            </p>
            </div>
        );
    }
}
export default PolicySelect;
